import React from 'react';
import ReactDOM from 'react-dom';

const fullName = "Nawaraj Luitel";
let current_date = new Date();

ReactDOM.render(
  <>
    <h1>{`My name is ${fullName}`}</h1>
    <p>The current date is {current_date.getDate()} {current_date.getMonth()} {current_date.getFullYear()}</p>
  </>,
  document.getElementById('root')
);
